import Profile from '../Profile/Profile.js';
import lImg from '../Images/lion.jpg';
import zImg from '../Images/zebra.jpg'
import cImg from '../Images/cat.jpg';
import eImg from '../Images/elephant.jpg'
import "./app.css";

export default function App() {
  function alertName(name,sound) {
    alert(`Hello I'm a ${name} \n and I ${sound}`);
  }
  return (
    <div className="App">
      <Profile style={{width: "25%"}}
        fullName="Lion"
        bio="The lion (Panthera leo) is a large cat of the genus Panthera native to Africa and India."
        nickName="The king of the jungle"
        sound="Roar"
        imge={lImg}
        alertName={alertName}
      />
      <Profile style={{width: "25%"}}
        fullName="Zebra"
        bio="Zebras are African equines with distinctive black-and-white striped coats."
        nickName="ZigZaggy barcoded Mr. Zed"
        sound="Bray"
        imge={zImg}
        alertName={alertName}
      />
      <Profile style={{width: "25%"}}
        fullName="Cat"
        bio="The cat (Felis catus) is a domestic species of small carnivorous mammal."
        nickName="The king of you house"
        sound="Meow"
        imge={cImg}
        alertName={alertName}
      />
      <Profile style={{width: "25%"}}
        fullName="Elephant"
        bio="Elephants are the largest existing land animals."
        nickName="Goliath"
        sound="Trumpet"
        imge={eImg}
        alertName={alertName}
      />
    </div>
    );
}
